import React, {Component, Fragment} from "react";
import {Link} from "react-router-dom";
import "./CafeSearch.css";
import Search from "./Components/Search.js";
import {MDBListGroup, MDBListGroupItem, MDBContainer} from "mdbreact";

class CafeSearch extends React.Component {
  render() {
    return (
      <div>
        <div id="bar">
          <center>
            <Search onCreate={this.handleCreate} />
          </center>
        </div>

        <div>
          <CafeList />
        </div>
      </div>
    );
  }
}

class CafeList extends React.Component {
  render() {
    return (
      <div>
        <div>
          <h4>"{}에 대한 검색 결과입니다."</h4>
        </div>

        <div>
          const MyListGroup = () =>{" "}
          {
            <MDBContainer>
              <MDBListGroup style={{width: "22rem"}}>
                <MDBListGroupItem href="#" active>
                  Cras justo odio
                </MDBListGroupItem>
                <MDBListGroupItem href="#" hover>
                  Dapibus ac facilisis in
                </MDBListGroupItem>
                <MDBListGroupItem href="#" hover>
                  Morbi leo risus
                </MDBListGroupItem>
                <MDBListGroupItem href="#" hover>
                  Porta ac consectetur ac
                </MDBListGroupItem>
                <MDBListGroupItem href="#" disabled>
                  Vestibulum at eros
                </MDBListGroupItem>
              </MDBListGroup>
            </MDBContainer>
          }
        </div>
      </div>
    );
  }
}

export default CafeSearch;
